import React, { Component } from "react";

import "./Switch.css";

export default class Switch extends Component {
   render() {
      return (
         <div>
            <input
               type="checkbox"
               class="ios8-switch-dark ios8-switch-sm"
               id="Sort-ch1"
               onclick="cbc1(this)"
               unchecked
            />
            <label for="Sort-ch1">Sort</label>
         </div>
      );
   }
}
